import React from "react";
import { Route, Routes } from "react-router-dom";
import CategoryHome from "./components/categories/CategoryIndex";
import ProductList from "./components/products/ProductIndex";

function App() {
  return (
    <React.Fragment>
      <Routes>
        <Route path="/category" element={<CategoryIndex />}></Route>
        <Route
          path="/category/:id"
          element={<ProductIndex />}
        ></Route>
        {/* <Route path="/product/:id" element={<ProductDetail />}></Route>*/}
      </Routes>
    </React.Fragment>
  );
}

export default App;
